import React from "react";
import { useSelector } from "react-redux";
import './profileComponent.css';

const ProfileComponent = () => {
    const profiles = useSelector((state) => state)
    console.log(profiles)
    return (
        <div className="card"> 
            <div className="avatar">
                <img src="./avatar.svg" alt="avatar" className="profile__image"/>
            </div>
            <div className="profileinfo">
                <div className="profile__name"> Jigyashu </div>
                <div className="profile__email"> <span class="material-icons">email</span>Jigyashu@ </div>
                <div className="profile__phone"> <span class="material-icons">call</span> Hello </div>
                <div className="profile__website"> <span class="material-icons">language</span>www.hh.com </div> 
            </div>
            <div className="buttons">
                <button className="likePost"><span style={{fontSize: "13px"}} class="material-icons">favorite_border</span></button>
                <button className="editPost"><span style={{fontSize: "13px"}} class="material-icons">edit</span></button>
                <button className="deletePost"><span style={{fontSize: "13px"}} class="material-icons">delete</span></button>
            </div>
        </div> 
    );
};


export default ProfileComponent;
